import React, { Component } from 'react';
import { Container, Col, Row } from 'reactstrap';
import './App.css';

class Button extends Component {
  render() {
    return (
        <Container>
            <button onclick="start()">
                <h3>Start</h3>
            </button>
        </Container>
    );
  }
}

export default Button;
